I have a Tooltip component that I want to use in different places in my NextJS application. However, I want to ensure that when a new Tooltip is opened, any previously opened Tooltip is closed. Since these Tooltips are isolated from each other and don't have a shared context, I'm looking for a way to manage their state globally.

Here's a basic structure of my Tooltip component:

```jsx
