1. **Create a Tooltip Context**: This context will hold the state and functions to manage the Tooltips.
2. **Create a Tooltip Provider**: This provider will wrap your application and provide the context to all Tooltip components.
3. **Update the Tooltip Component**: Modify the Tooltip component to use the context for managing its state.

Here's how you can implement it:

